  \"2015-11-20T22:42:05.413266\",\n\t\"name\": \"us-epa-region-4-brownfields\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To improve public health and the environment,
  the United States Environmental Protection Agency (USEPA) collects information about
  facilities, sites, or places subject to environmental regulation or of environmental
  interest. Through the Geospatial Data Download Service, the public is now able to
  download the EPA Geodata shapefile containing facility and site information from
  EPA's national program systems. The file is Internet accessible from the Envirofacts
  Web site (http://www.epa.gov/enviro). The data may be used with geospatial mapping
  applications. (Note: The shapefile omits facilities without latitude/longitude coordinates.)
  The EPA Geospatial Data contains the name, location (latitude/longitude), and EPA
  program information about specific facilities and sites. In addition, the file contains
  a Uniform Resource Locator (URL), which allows mapping applications to present an
  option to users to access additional EPA data resources on a specific facility or
  site. This dataset shows Brownfields listed in the 2012 Facility Registry System.\",\n\t\"license_title\":
